import {createApp} from 'vue'
import App from './App.vue'

createApp(App).mount('#app')
import {login} from "@/utils/api";
import axios from "axios";
axios.get("http://localhost:8080//todo/1").then(res=>{
    console.log(res)
}).catch(err=>{
    console.log(err)
})
login("admin", "admin")
